```json
{
  "application": "Slurm",
  "other_software": [
    "Bash",
    "Conda",
    "Mamba",
    "Micromamba"
  ],
  "resource_requirements": {
    "time": {
      "default": "01:00:00",
      "description": "Maximum (wall-)runtime for the job in HH:MM:SS format"
    },
    "cpus": {
      "default": "1",
      "description": "Number of CPUs required for the job"
    },
    "memory": {
      "default": "1G",
      "description": "Maximum amount of RAM consumed by the job"
    },
    "blacklist": {
      "description": "Comma-separated black-list of nodes not to use (default: all nodes allowed)"
    },
    "queue": {
      "description": "Which queue to use (default: default queue)"
    },
    "conda_env": {
      "description": "Activate the given conda environment for the job"
    },
    "skipValidation": {
      "description": "Skip conda environment activation (faster submission but will lead to failed jobs if the environment isn't valid)"
    },
    "report": {
      "description": "Report success or failure of the job at the end of the log file"
    }
  }
}
```
